import java.util.logging.Level;
import java.util.logging.Logger;

public class Caballos implements Runnable {
    
    // Variables
    private String name; 
    private int tiempo;

    Caballos(String name){
        this.name = name;
    }        
    
    @Override
    public void run() { // Cada vez que se lance el start 5        
        
        try{
            System.out.println("Sale "+this.name);
            // Obtener un tiempo aleatorio entre 1 y 9 segundos
            tiempo = (int) Math.max(1,Math.floor(Math.random()*10)); 
            // Pausar el hilo durante n segundos, siendo n = tiempo
            Thread.sleep(tiempo*1000);
            // Informar al usuario
            System.out.println("Soy el caballo "+this.name+" y he tardado "+tiempo+" segundos.");
        } catch (InterruptedException ex){
            Logger.getLogger(Caballos.class.getName()).log(Level.SEVERE, null, ex);
        }
                
    }
    
    public String getNombre(){
        return this.name;
    }
    
    public int getTiempo(){
        return this.tiempo;
    }
    
}

