bool isValid(vector<vi> &grid, int x, int y)
{
    int n = grid.size();
    int m = grid[0].size();

    return (0 <= x && x < n) && (0 <= y && y < m);
}

int fun(vector<vi> &grid, int i, int j, int b, int k, int consec, vector<vector<vi>> &dp)
{
    if (dp[i][j][consec] != -1)
    {
        return dp[i][j][consec];
    }

    int d = -1, r = -1;
    int n = grid.size();
    int m = grid[0].size();
    if(i == n - 1 && j == m - 1)
    {
        return grid[i][j];
    }
    if (grid[i][j] < b)
    {
        // bad
        if (isValid(grid, i + 1, j) && ((consec + 1 < k)))
            d = grid[i][j] + fun(grid, i + 1, j, b, k, consec + 1, dp);
        if (isValid(grid, i, j + 1) && (consec + 1 < k))
            r = grid[i][j] + fun(grid, i, j + 1, b, k, consec + 1, dp);
    }
    if (isValid(grid, i + 1, j))
        d = grid[i][j] + fun(grid, i + 1, j, b, k, 0, dp);
    if (isValid(grid, i, j + 1))
        r = grid[i][j] + fun(grid, i, j + 1, b, k, 0, dp);
    return dp[i][j][consec] = max(d, r);
}

void solve()
{
    int n, m, k, b;
