/* operatory arytmetyczne:
	+	dodawanie
	-	odejmowanie
	*	mnożenie
	/	dzielenie
	%	modulo (reszta z dzielenia)
*/

int main() {
	std::cout << 10 + 5 << std::endl;		// wypisanie na ekran wartości działania (w tym wypadku 15)
	std::cout << "10 + 5" << std::endl;		// wypisanie na ekran TEKSTU "10 + 5"
	// operacje arytmetyczne można też stosować na wartościach zmiennych
	int a{ 3 }, b{ 7 };						// deklaracja z inicjalizacją dwóch zmiennych tego samego typu po przecinkach
	std::cout << a << " + " << b << " = " << a + b << std::endl;		// wypisz na ekran:	3 + 7 = 10
	std::cout << a << " - " << b << " = " << a - b << std::endl;
	std::cout << a << " * " << b << " = " << a * b << std::endl;
	std::cout << a << " / " << b << " = " << a / b << std::endl;
	std::cout << b << " / " << a << " = " << b / a << std::endl;
	// uwaga: dzielenie wartości dwóch zmiennych typu całkowitego (np. int) da wynik całkowity!
	float x{ 1.3 };
	std::cout << b << " / " << x << " = " << b / x << std::endl;
	// wystarczy, że jedna ze zmiennych biorących udział w dzieleniu nie jest liczbą całkowitą, a wynik będzie zmiennoprzecinkowy
	std::cout << a << " / " << b << " = " << 1.0 * a / b << std::endl;
	std::cout << b << " / " << a << " = " << 1.0 * b / a << std::endl;
	return 0;
}

