void SearchServer::RemoveDocument(int document_id) {
    return RemoveDocument(std::execution::seq, document_id);
}

void SearchServer::RemoveDocument(const std::execution::sequenced_policy&, int document_id) {
    if (!document_ids_.count(document_id)) {
        throw std::invalid_argument("Invalid document ID to remove"s);
    }

    document_ids_.erase(document_id);

    if (documents_.count(document_id)) {
        documents_.erase(document_id);
    }

    for (auto& element : SearchServer::word_to_document_freqs_) {
        if (element.second.count(document_id)) {
            element.second.erase(document_id);
        }
    }

    if (document_to_word_freqs_.count(document_id)) {
        document_to_word_freqs_.erase(document_id);
    }
}

void SearchServer::RemoveDocument(const std::execution::parallel_policy&, int document_id) {
    if (!document_ids_.count(document_id)) {
        throw std::invalid_argument("Invalid document ID to remove"s);
    }

    std::map<std::string, double> word_freqs = document_to_word_freqs_.at(document_id);
    std::vector<const std::string*> words_to_erase(word_freqs.size());

    std::transform(std::execution::par, word_freqs.begin(), word_freqs.end(),
        words_to_erase.begin(),
        [](const auto& words_freq) { return &words_freq.first; });

    std::for_each(std::execution::par, words_to_erase.begin(), words_to_erase.end(),
        [this, document_id](const auto& word) {word_to_document_freqs_.at(*word).erase(document_id); });

    documents_.erase(document_id);
    document_ids_.erase(document_id);
    document_to_word_freqs_.erase(document_id);
}

#include <cstring>
#include <iostream>

struct Node {
  char* data;
  Node* next = nullptr;
  Node* prev = nullptr;
};

void Input(char*& string) {
  char cur = getchar();
  if (cur == ' ') {
    cur = getchar();
  }
  size_t size = 0;
  size_t capacity = 1;
  while ((cur >= 'A' && cur <= 'Z') || (cur >= '0' && cur <= '9') ||
         (cur >= 'a' && cur <= 'z') || cur == '-') {
    if (size + 1 == capacity) {
      capacity *= 2;
      char* new_str = new char[capacity]();
      char* tmp = string;
      memcpy(new_str, string, size);
      string = new_str;
      delete[] tmp;
    }
    string[size] = cur;
    ++size;
    string[size] = '\0';
    cur = getchar();
  }
}

void Push(Node*& begin, Node*& end, char*& string, size_t& size) {
  if (begin == end && end == nullptr) {
    begin = end = new Node;
  } else {
    end->next = new Node;
    end->next->prev = end;
    end = end->next;
  }
  end->data = string;
  size++;
}

void Pop(Node*& begin, Node*& end) {
  if (end == nullptr) {
    std::cout << "error\n";
    return;
  }
  std::cout << end->data << '\n';
  if (begin == end) {
    delete[] end->data;
    delete end;
    begin = end = nullptr;
    return;
  }
  delete[] end->data;
  end = end->prev;
  delete end->next;
  end->next = nullptr;
}

void Back(Node*& end) {
  if (end == nullptr) {
    std::cout << "error\n";
    return;
  }
  std::cout << end->data << '\n';
}

void Clear(Node*& begin, Node*& end, size_t& size) {
  if (begin == nullptr) {
    return;
  }
  while (begin != end) {
    delete[] end->data;
    end = end->prev;
    delete end->next;
  }
  delete[] end->data;
  delete end;
  begin = end = nullptr;
  size = 0;
}

bool Request(Node*& begin, Node*& end, size_t& size) {
  char* request = new char[8]{};
  std::cin >> request;
  if (memcmp(request, "push", 4) == 0) {
    char* string = new char[1];
    string[0] = '\0';
    Input(string);
    Push(begin, end, string, size);
    std::cout << "ok\n";
  } else if (memcmp(request, "pop", 3) == 0) {
    Pop(begin, end);
    if (size != 0) {
      size--;
    }
  } else if (memcmp(request, "size", 4) == 0) {
    std::cout << size << '\n';
  } else if (memcmp(request, "back", 4) == 0) {
    Back(end);
  } else if (memcmp(request, "clear", 5) == 0) {
    Clear(begin, end, size);
    std::cout << "ok\n";
  } else if (memcmp(request, "exit", 4) == 0) {
    std::cout << "bye\n";
    delete[] request;
    return false;
  }
  delete[] request;
  return true;
}

signed main() {
  Node* begin = nullptr;
  Node* end = nullptr;
  size_t size = 0;

  while (Request(begin, end, size)) {
  }
  Clear(begin, end, size);
}

